const MostCommon = ["Dry Cough", "Fever", "Tiredness"];

const LessCommon = ["aches and pains", "sore throat", "diarrhoea", "conjunctivitis", "headache", "loss of taste or smell", "a rash on skin, or discolouration of fingers or toes"];

const Serious = ["difficulty breathing or shortness of breath", "chest pain or pressure", "loss of speech or movement"];

export default MostCommon;
export { LessCommon, Serious };
